"use strict";(self.webpackChunkuyirkural=self.webpackChunkuyirkural||[]).push([[971],{971:a=>{a.exports=JSON.parse('[{"kural":"41","vari1":"\u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbe\u0ba9\u0bcd \u0b8e\u0ba9\u0bcd\u0baa\u0bbe\u0ba9\u0bcd \u0b87\u0baf\u0bb2\u0bcd\u0baa\u0bc1\u0b9f\u0bc8\u0baf \u0bae\u0bc2\u0bb5\u0bb0\u0bcd\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd","vari2":"\u0ba8\u0bb2\u0bcd\u0bb2\u0bbe\u0bb1\u0bcd\u0bb1\u0bbf\u0ba9\u0bcd \u0ba8\u0bbf\u0ba9\u0bcd\u0bb1 \u0ba4\u0bc1\u0ba3\u0bc8.","vilakkam":"\u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0ba4\u0bcd\u0ba4\u0bbf\u0bb2\u0bbf\u0bb0\u0bc1\u0baa\u0bcd\u0baa\u0ba4\u0bc1 \u0b8e\u0ba9\u0bcd\u0baa\u0ba4\u0bc1, \u0bae\u0ba9\u0bc8\u0bb5\u0bbf, \u0b95\u0bc1\u0bb4\u0ba8\u0bcd\u0ba4\u0bc8(\u0b95\u0bb3\u0bcd) \u0bae\u0bb1\u0bcd\u0bb1\u0bc1\u0bae\u0bcd \u0baa\u0bc6\u0bb1\u0bcd\u0bb1\u0bcb\u0bb0\u0bc1\u0b95\u0bcd\u0b95\u0bc1 \u0ba8\u0bb2\u0bcd\u0bb2 \u0bb5\u0bb4\u0bbf\u0baf\u0bbf\u0bb2\u0bcd \u0ba4\u0bc1\u0ba3\u0bc8\u0ba8\u0bbf\u0ba9\u0bcd\u0bb1\u0bc1 \u0b89\u0ba4\u0bb5\u0bc1\u0bae\u0bcd \u0b85\u0bb1\u0bae\u0bbe\u0b95\u0bc1\u0bae\u0bcd. \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0bae\u0bcd \u0b8e\u0ba9\u0bcd\u0baa\u0ba4\u0bc1, \u0b87\u0bb2\u0bcd\u0bb2\u0ba4\u0bcd\u0ba4\u0bbf\u0ba9\u0bcd \u0b85\u0bb1\u0bae\u0bcd. \u0baa\u0bca\u0ba4\u0bc1\u0bb5\u0bbe\u0b95 \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0bae\u0bcd \u0b8e\u0ba9\u0bcd\u0bb1\u0ba4\u0bc1\u0bae\u0bcd, \u0b85\u0ba4\u0bc1 \u0ba4\u0bbf\u0bb0\u0bc1\u0bae\u0ba3\u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bc1 \u0b8e\u0ba9 \u0baa\u0bca\u0bb0\u0bc1\u0bb3\u0bcd \u0ba4\u0bc6\u0bb3\u0bbf\u0bb5\u0ba4\u0bc1\u0ba3\u0bcd\u0b9f\u0bc1. \u0b85\u0ba4\u0bc1\u0bb5\u0bcb, \u0b87\u0bb2\u0bcd\u0bb2\u0ba4\u0bcd\u0ba4\u0bb5\u0bb0\u0bcd\u0b95\u0bb3\u0bbe\u0b95\u0bbf\u0baf, \u0bae\u0ba9\u0bc8\u0bb5\u0bbf, \u0b95\u0bc1\u0bb4\u0ba8\u0bcd\u0ba4\u0bc8\u0b95\u0bb3\u0bcd \u0bae\u0bb1\u0bcd\u0bb1\u0bc1\u0bae\u0bcd \u0baa\u0bc6\u0bb1\u0bcd\u0bb1\u0bcb\u0bb0\u0bc8 \u0baa\u0bc7\u0ba3\u0bc1\u0bb5\u0ba4\u0bbe\u0b95\u0bc1\u0bae\u0bcd. \u0bae\u0bc2\u0bb5\u0bb0\u0bcd\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0ba8\u0bb2\u0bcd\u0bb5\u0bb4\u0bbf\u0baf\u0bbf\u0bb2\u0bcd \u0ba4\u0bc1\u0ba3\u0bc8\u0ba8\u0bbf\u0bb1\u0bcd\u0baa\u0ba4\u0bc7 \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0bae\u0bcd \u0b86\u0b95\u0bc1\u0bae\u0bcd."},{"kural":"42","vari1":"\u0ba4\u0bc1\u0bb1\u0ba8\u0bcd\u0ba4\u0bbe\u0bb0\u0bcd\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0ba4\u0bc1\u0bb5\u0bcd\u0bb5\u0bbe\u0ba4\u0bb5\u0bb0\u0bcd\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0b87\u0bb1\u0ba8\u0bcd\u0ba4\u0bbe\u0bb0\u0bcd\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd","vari2":"\u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbe\u0ba9\u0bcd \u0b8e\u0ba9\u0bcd\u0baa\u0bbe\u0ba9\u0bcd \u0ba4\u0bc1\u0ba3\u0bc8.","vilakkam":"\u0baf\u0bbe\u0bb5\u0bc1\u0bae\u0bcd \u0ba4\u0bc1\u0bb1\u0ba8\u0bcd\u0ba4\u0bb5\u0bb0\u0bcd\u0ba4\u0bae\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd, \u0bb5\u0bb1\u0bc1\u0bae\u0bc8\u0baf\u0bbf\u0bb2\u0bcd \u0bb5\u0bbe\u0b9f\u0bbf\u0ba8\u0bbf\u0bb1\u0bcd\u0baa\u0bb5\u0bb0\u0bcd\u0b95\u0bb3\u0bc1\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd, \u0bae\u0bc1\u0ba9\u0bcd\u0ba9\u0bcb\u0bb0\u0bcd\u0b95\u0bb3\u0bc1\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0bb2\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0baa\u0bb5\u0bb0\u0bc7 \u0ba4\u0bc1\u0ba3\u0bc8\u0baf\u0bbe\u0bb5\u0bb0\u0bcd. \u0ba4\u0bc1\u0bb1\u0bb5\u0bbf\u0b95\u0bb3\u0bc1\u0b95\u0bcd\u0b95\u0bc1 \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0bb2\u0bcd \u0b87\u0bb0\u0bc1\u0baa\u0bcd\u0baa\u0bb5\u0bb0\u0bcd\u0b95\u0bb3\u0bcd \u0ba4\u0bc1\u0ba3\u0bc8\u0baf\u0bbe\u0b95 \u0ba4\u0bbf\u0b95\u0bb4\u0bb5\u0bc7\u0ba3\u0bcd\u0b9f\u0bc1\u0bae\u0bcd \u0b8e\u0ba9\u0bc1\u0bae\u0bcd\u0baa\u0bcb\u0ba4\u0bc1, \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0bb2\u0bc1\u0bb3\u0bcd\u0bb3\u0bcb\u0bb0\u0bcd \u0ba4\u0bc1\u0bb1\u0bb5\u0bb1\u0ba4\u0bcd\u0ba4\u0bbf\u0bb1\u0bcd\u0b95\u0bc1 \u0ba4\u0bc1\u0ba3\u0bc8\u0baa\u0bcb\u0b95\u0bb5\u0bc7\u0ba3\u0bcd\u0b9f\u0bc1\u0bae\u0bcd \u0b8e\u0ba9\u0bc1\u0bae\u0bbe\u0bb1\u0bc1 \u0baa\u0bca\u0bb0\u0bc1\u0bb3\u0bcd \u0bae\u0bc1\u0ba9\u0bcd\u0baa\u0bbf\u0ba9\u0bcd \u0bae\u0bc1\u0bb1\u0ba9\u0bbe\u0b95 \u0bb5\u0bb0 \u0b95\u0bbe\u0ba3\u0bcd\u0b95\u0bbf\u0bb1\u0bcb\u0bae\u0bcd. \u0b8e\u0ba9\u0bcd \u0baa\u0bbe\u0bb0\u0bcd\u0bb5\u0bc8\u0baf\u0bbf\u0bb2\u0bcd, \u201c\u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0bae\u0bc7 \u0b92\u0bb0\u0bc1 \u0ba4\u0bb5\u0bae\u0bcd\u201d. \u0b85\u0ba8\u0bcd\u0ba4 \u0ba4\u0bb5 \u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8, \u0baa\u0bcb\u0bb1\u0bcd\u0bb1\u0bbf \u0b86\u0ba4\u0bb0\u0bbf\u0b95\u0bcd\u0b95\u0baa\u0bcd\u0baa\u0b9f\u0bb5\u0bc7\u0ba3\u0bcd\u0b9f\u0bbf\u0baf\u0ba4\u0bc1. \u0bb5\u0bb1\u0bc1\u0bae\u0bc8\u0baf\u0bbf\u0bb2\u0bcd \u0bb5\u0bbe\u0b9f\u0bbf\u0baf\u0bb5\u0bb0\u0bcd\u0b95\u0bb3\u0bbf\u0ba9\u0bcd \u0bae\u0bc1\u0b95\u0bae\u0bcd \u0bb5\u0bbe\u0b9f\u0bc1\u0b95\u0bc8\u0baf\u0bbf\u0bb2\u0bcd, \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0ba4\u0bcd\u0ba4\u0bcb\u0ba9\u0bcd \u0bae\u0ba9\u0ba4\u0bcd\u0ba4\u0bbf\u0bb2\u0bcd, \u0ba4\u0ba9\u0bcd \u0b87\u0bb2\u0bcd\u0bb2\u0ba4\u0bcd\u0ba4\u0bbe\u0bb0\u0bcd\u0ba4\u0bae\u0bcd \u0bae\u0bc1\u0b95\u0b99\u0bcd\u0b95\u0bb3\u0bcd \u0bb5\u0bb0\u0bb5\u0bc7\u0ba3\u0bcd\u0b9f\u0bc1\u0bae\u0bcd. \u0bb5\u0bbe\u0b9f\u0bbf\u0baf\u0bb5\u0bb0\u0bc8 \u0ba4\u0bc7\u0bb1\u0bcd\u0bb1\u0bbf\u0b9f\u0bb2\u0bcd \u0bb5\u0bc7\u0ba3\u0bcd\u0b9f\u0bc1\u0bae\u0bcd. \u0b87\u0ba9\u0bcd\u0bb1\u0bc1 \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0ba4\u0bcd\u0ba4\u0bbf\u0bb2\u0bcd \u0b95\u0bcb\u0bb2\u0bcb\u0b9a\u0bcd\u0b9a\u0bbf, \u0bae\u0b95\u0bcd\u0b95\u0bb3\u0bc1\u0bb3\u0bcd \u0b95\u0bbf\u0bb3\u0bc8\u0b95\u0bb3\u0bcd \u0b95\u0bca\u0b9e\u0bcd\u0b9a\u0bbf\u0bb5\u0bbe\u0bb4 \u0b95\u0bbe\u0bb0\u0ba3\u0bae\u0bc7 \u0bae\u0bc1\u0ba9\u0bcd\u0ba9\u0bcb\u0bb0\u0bcd\u0ba4\u0bbe\u0ba9\u0bcd. \u0bae\u0bc1\u0ba9\u0bcd\u0ba9\u0bcb\u0bb0\u0bc8 \u0bae\u0bb1\u0ba4\u0bcd\u0ba4\u0bb2\u0bcd, \u0ba4\u0bae\u0bbf\u0bb4\u0bb0\u0bcd \u0bae\u0bc6\u0baf\u0bcd\u0baf\u0bbf\u0baf\u0bb2\u0bc1\u0b95\u0bcd\u0b95\u0bc1 \u0baa\u0bc1\u0bb1\u0bae\u0bcd\u0baa\u0bbe\u0ba9\u0ba4\u0bc1. \u0ba4\u0bc1\u0bb1\u0ba8\u0bcd\u0ba4\u0bbe\u0bb0\u0bcd, \u0bb5\u0bbe\u0b9f\u0bc1\u0bb5\u0bcb\u0bb0\u0bcd, \u0bae\u0bc1\u0ba9\u0bcd\u0ba9\u0bcb\u0bb0\u0bcd\u0ba4\u0bae\u0b95\u0bcd\u0b95\u0bc1 \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0ba4\u0bcd\u0ba4\u0bcb\u0ba9\u0bc7 \u0b8f\u0bb1\u0bcd\u0bb1 \u0ba4\u0bc1\u0ba3\u0bc8."},{"kural":"43","vari1":"\u0ba4\u0bc6\u0ba9\u0bcd\u0baa\u0bc1\u0bb2\u0ba4\u0bcd\u0ba4\u0bbe\u0bb0\u0bcd \u0ba4\u0bc6\u0baf\u0bcd\u0bb5\u0bae\u0bcd \u0bb5\u0bbf\u0bb0\u0bc1\u0ba8\u0bcd\u0ba4\u0bca\u0b95\u0bcd\u0b95\u0bb2\u0bcd \u0ba4\u0bbe\u0ba9\u0bc6\u0ba9\u0bcd\u0bb1\u0bbe\u0b99\u0bcd\u0b95\u0bc1","vari2":"\u0b90\u0bae\u0bcd\u0baa\u0bc1\u0bb2\u0ba4\u0bcd\u0ba4\u0bbe\u0bb1\u0bc1 \u0b93\u0bae\u0bcd\u0baa\u0bb2\u0bcd \u0ba4\u0bb2\u0bc8.","vilakkam":"\u0ba4\u0bc6\u0ba9\u0bcd\u0baa\u0bc1\u0bb2\u0ba4\u0bcd\u0ba4\u0bbe\u0bb0\u0bcd, \u0ba4\u0bc6\u0baf\u0bcd\u0bb5\u0bae\u0bcd, \u0bb5\u0bbf\u0bb0\u0bc1\u0ba8\u0bcd\u0ba4\u0bbf\u0ba9\u0bb0\u0bcd, \u0b9a\u0bc1\u0bb1\u0bcd\u0bb1\u0ba4\u0bcd\u0ba4\u0bbe\u0bb0\u0bcd \u0bae\u0bb1\u0bcd\u0bb1\u0bc1\u0bae\u0bcd \u0ba4\u0bbe\u0ba9\u0bcd \u0b8e\u0ba9\u0bc1\u0bae\u0bcd \u0b90\u0bb5\u0bb0\u0bc1\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0b89\u0b95\u0ba8\u0bcd\u0ba4 \u0b85\u0bb1\u0b9e\u0bcd\u0b9a\u0bc6\u0baf\u0bcd\u0ba4\u0bc1 \u0bb5\u0bbe\u0bb4\u0bc1\u0ba4\u0bb2\u0bcd, \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0ba4\u0bcd\u0ba4\u0bbf\u0bb1\u0bcd\u0b95\u0bc1 \u0b9a\u0bbf\u0bb1\u0baa\u0bcd\u0baa\u0bc1! \u201c\u0ba4\u0bc6\u0bb1\u0bcd\u0b95\u0bc1 \u0b8e\u0ba9\u0bcd\u0baa\u0ba4\u0bc1 \u0b85\u0bb4\u0bbf\u0bb5\u0bbf\u0ba9\u0bcd \u0ba4\u0bbf\u0b9a\u0bc8\u201d \u0b8e\u0ba9 \u0baa\u0b9e\u0bcd\u0b9a\u0bae\u0bbe\u0baa\u0bbe\u0ba4\u0b95\u0ba4\u0bcd\u0ba4\u0bc1\u0bae\u0bcd \u0b85\u0b9e\u0bcd\u0b9a\u0bbe\u0ba4 \u0b95\u0bc2\u0b9f\u0bcd\u0b9f\u0bae\u0bcd \u0b9a\u0bbf\u0bb2 \u0b95\u0bc2\u0bb1\u0bbf \u0ba4\u0bbf\u0bb0\u0bbf\u0bb5\u0ba4\u0bc1\u0ba3\u0bcd\u0b9f\u0bc1. \u0ba4\u0bc6\u0bb1\u0bcd\u0b95\u0bc7 \u0b85\u0ba9\u0bc8\u0ba4\u0bcd\u0ba4\u0bbf\u0bb1\u0bcd\u0b95\u0bc1 \u0b86\u0ba4\u0bbe\u0bb0 \u0ba4\u0bbf\u0b9a\u0bc8! \u0ba4\u0bc6\u0bb1\u0bcd\u0b95\u0bc7 \u0ba4\u0bc6\u0ba9\u0bcd\u0baa\u0bc1\u0bb2\u0ba4\u0bcd\u0ba4\u0bbe\u0bb0\u0bcd \u0b8e\u0ba9\u0bc1\u0bae\u0bcd \u0bae\u0bc1\u0ba9\u0bcd\u0ba9\u0bcb\u0bb0\u0bc8 \u0ba4\u0bca\u0bb4\u0bb2\u0bcd \u0ba4\u0bcb\u0ba9\u0bcd\u0bb1\u0bbf\u0baf \u0ba4\u0bbf\u0b9a\u0bc8! \u0ba4\u0bc6\u0ba9\u0bcd\u0baa\u0bc1\u0bb2\u0ba4\u0bcd\u0ba4\u0bbe\u0bb0\u0bcd \u0bb5\u0bb4\u0bbf\u0baa\u0bbe\u0b9f\u0bcd\u0b9f\u0bbf\u0ba9\u0bcd \u0baa\u0bc6\u0baf\u0bb0\u0bcd\u0ba4\u0bcd\u0ba4\u0bbe\u0b95\u0bcd\u0b95\u0bae\u0bcd \u0baa\u0bc6\u0bb1\u0bcd\u0bb1\u0ba4\u0bc7 Temple \u0b8e\u0ba9\u0bc1\u0bae\u0bcd \u0b86\u0b99\u0bcd\u0b95\u0bbf\u0bb2 \u0baa\u0ba4\u0bae\u0bcd. \u0b87\u0ba4\u0bc1 \u0bae\u0bb1\u0bc1\u0ba4\u0bb2\u0bbf\u0b95\u0bcd\u0b95 \u0bae\u0bc1\u0b9f\u0bbf\u0baf\u0bbe\u0ba4\u0ba4\u0bc1. \u0ba4\u0bc6\u0ba9\u0bcd\u0baa\u0bc1\u0bb2\u0ba4\u0bcd\u0ba4\u0bbe\u0bb0\u0bbe\u0ba9 \u0bae\u0bc1\u0ba9\u0bcd\u0ba9\u0bcb\u0bb0\u0bcd, \u0ba4\u0bc0\u0baf\u0bbe\u0baf\u0bcd \u0b95\u0bbe\u0ba3\u0bb5\u0bca\u0ba9\u0bcd\u0ba9\u0bbe\u0ba4 \u0b95\u0bb0\u0bc1\u0bae\u0bc2\u0ba9\u0bae\u0bbe\u0ba9 \u0ba4\u0bc6\u0baf\u0bcd\u0bb5\u0bae\u0bcd, \u0bb5\u0bc0\u0b9f\u0bc1\u0ba4\u0bc7\u0b9f\u0bbf \u0bb5\u0ba8\u0bcd\u0ba4 \u0bb5\u0bbf\u0bb0\u0bc1\u0ba8\u0bcd\u0ba4\u0bbf\u0ba9\u0bb0\u0bcd, \u0b92\u0ba9\u0bcd\u0bb1\u0bc6\u0ba9\u0bcd\u0bb1\u0bbe\u0bb2\u0bcd \u0ba8\u0bbe\u0bb3\u0bc8 \u0b89\u0baf\u0bbf\u0bb0\u0bcd\u0b95\u0bbe\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0b9a\u0bc1\u0bb1\u0bcd\u0bb1\u0bae\u0bcd \u0bae\u0bb1\u0bcd\u0bb1\u0bc1\u0bae\u0bcd \u0b85\u0ba9\u0bc8\u0ba4\u0bcd\u0ba4\u0bbf\u0bb1\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0b86\u0ba4\u0bbe\u0bb0\u0bae\u0bbe\u0ba9 \u0ba4\u0bbe\u0ba9\u0bcd \u0b8e\u0ba9\u0bcd\u0bb1 \u0b90\u0bb5\u0bb0\u0bc1\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0b8f\u0bb1\u0bcd\u0bb1 \u0b85\u0bb1\u0b9e\u0bcd\u0b9a\u0bc6\u0baf\u0bcd\u0bb5\u0ba4\u0bc1, \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0ba4\u0bcd\u0ba4\u0bbf\u0bb2\u0bcd \u0b9a\u0bbe\u0baf\u0bc1\u0b9a\u0bcd\u0b9a\u0bae\u0bbe\u0ba9 \u0b9a\u0bbf\u0bb1\u0baa\u0bcd\u0baa\u0bc1!"},{"kural":"44","vari1":"\u0baa\u0bb4\u0bbf\u0baf\u0b9e\u0bcd\u0b9a\u0bbf\u0baa\u0bcd \u0baa\u0bbe\u0ba4\u0bcd\u0ba4\u0bc2\u0ba3\u0bcd \u0b89\u0b9f\u0bc8\u0ba4\u0bcd\u0ba4\u0bbe\u0baf\u0bbf\u0ba9\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8","vari2":"\u0bb5\u0bb4\u0bbf\u0baf\u0bc6\u0b9e\u0bcd\u0b9a\u0bb2\u0bcd \u0b8e\u0b9e\u0bcd\u0b9e\u0bbe\u0ba9\u0bcd\u0bb1\u0bc1\u0bae\u0bcd \u0b87\u0bb2\u0bcd.","vilakkam":"\u0baa\u0bb4\u0bbf\u0bb5\u0bb0\u0bbe\u0ba4 \u0bb5\u0ba3\u0bcd\u0ba3\u0bae\u0bcd \u0baa\u0bca\u0bb0\u0bc1\u0bb3\u0bcd\u0b9a\u0bc7\u0bb0\u0bcd\u0ba4\u0bcd\u0ba4\u0bc1, \u0b89\u0ba3\u0bb5\u0bc1\u0ba3\u0bcd\u0b9f\u0bc1 \u0bb5\u0bbe\u0bb4\u0bc1\u0bae\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0bb2\u0bcd, \u0b92\u0bb0\u0bc1\u0baa\u0bcb\u0ba4\u0bc1\u0bae\u0bcd \u0b92\u0bb4\u0bc1\u0b99\u0bcd\u0b95\u0bc1 \u0b95\u0bc1\u0bb2\u0bc8\u0bb5\u0ba4\u0bbf\u0bb2\u0bcd\u0bb2\u0bc8. \u0baa\u0bca\u0bb0\u0bc1\u0bb3\u0bcd\u0b9a\u0bc7\u0bb0\u0bcd\u0b95\u0bcd\u0b95 \u0b86\u0baf\u0bbf\u0bb0\u0bae\u0bcd \u0bb5\u0bb4\u0bbf\u0b95\u0bb3\u0bcd \u0b89\u0bb3\u0bcd\u0bb3\u0ba9. \u0b86\u0ba9\u0bbe\u0bb2\u0bcd, \u0ba4\u0bc6\u0bb0\u0bbf\u0ba8\u0bcd\u0ba4\u0bc6\u0b9f\u0bc1\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0bb5\u0bb4\u0bbf\u0baf\u0bcb, \u0baf\u0bbe\u0bb0\u0bc1\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0b87\u0ba9\u0bcd\u0ba9\u0bb2\u0bcd\u0ba4\u0bb0\u0bbe\u0ba4\u0ba4\u0bbe\u0baf\u0bcd, \u0baa\u0bbf\u0bb1\u0bb0\u0bcd \u0baa\u0bb4\u0bbf\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0bb5\u0ba3\u0bcd\u0ba3\u0bae\u0bcd \u0b87\u0bb0\u0bc1\u0ba8\u0bcd\u0ba4\u0bbf\u0b9f\u0bbe\u0bae\u0bb2\u0bbf\u0bb0\u0bc1\u0b95\u0bcd\u0b95\u0bb5\u0bc7\u0ba3\u0bcd\u0b9f\u0bc1\u0bae\u0bcd... \u0baa\u0bbf\u0bb1\u0bb0\u0bcd \u0bb5\u0bbe\u0baf\u0bcd, \u0bb5\u0baf\u0bbf\u0bb1\u0bcd\u0bb1\u0bbf\u0bb2\u0b9f\u0bbf\u0b95\u0bcd\u0b95, \u0b9a\u0bbf\u0bb2\u0bb0\u0bcd \u0ba8\u0bbe\u0bb0\u0bc1\u0b9a\u0bbf\u0b95\u0bcd\u0b95\u0ba3\u0bcd\u0b9f\u0bc1 \u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bbf\u0ba9\u0bcd\u0bb1\u0ba9\u0bb0\u0bcd. \u0b87\u0bb5\u0bb0\u0bcd\u0b95\u0bb3\u0ba4\u0bc1 \u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0bb2\u0bcd, \u0ba8\u0bbf\u0bae\u0bcd\u0bae\u0ba4\u0bbf\u0baf\u0bca\u0bb4\u0bc1\u0b99\u0bcd\u0b95\u0bc1 \u0b92\u0bb0\u0bc1\u0ba8\u0bbe\u0bb3\u0bcd \u0bae\u0bc6\u0ba4\u0bcd\u0ba4 \u0b9a\u0bb0\u0bbf\u0baf\u0bc1\u0bae\u0bcd. \u0b85\u0baa\u0bcd\u0baa\u0bcb\u0ba4\u0bc1 \u0b85\u0bb5\u0bb0\u0bcd\u0b95\u0bb3\u0bcd \u0baa\u0bb2 \u0ba8\u0bbe\u0b9f\u0b95\u0b99\u0bcd\u0b95\u0bbe\u0b9f\u0bcd\u0b9f\u0bbf, \u0b95\u0bc2\u0baa\u0bcd\u0baa\u0bbe\u0b9f\u0bbf\u0b9f\u0bcd\u0b9f\u0bc1 \u0b85\u0bb0\u0bc1\u0bb5\u0bb1\u0bc1\u0baa\u0bcd\u0baa\u0bbe\u0b95 \u0b93\u0bb2\u0bae\u0bcd \u0b87\u0b9f\u0bc1\u0bb5\u0bbe\u0bb0\u0bcd\u0b95\u0bb3\u0bcd. \u0b85\u0bb1\u0bae\u0bcd\u0baa\u0bbf\u0bb4\u0bc8\u0ba4\u0bcd\u0ba4\u0bcb\u0bb0\u0bc1\u0b95\u0bcd\u0b95\u0bc1, \u0b85\u0bb5\u0bcd\u0bb5\u0bb1\u0bae\u0bc7 \u0b95\u0bc2\u0bb1\u0bcd\u0bb1\u0bae\u0bbe\u0b95\u0bc1\u0bae\u0bcd! \u0ba4\u0bbf\u0bb0\u0bc8\u0b95\u0b9f\u0bb2\u0bcd \u0b93\u0b9f\u0bbf \u0ba4\u0bbf\u0bb0\u0bb5\u0bbf\u0baf\u0bae\u0bcd \u0ba4\u0bc7\u0b9f\u0bbf\u0ba9\u0bbe\u0bb2\u0bc1\u0bae\u0bcd, \u0b85\u0bb1\u0bb5\u0bb4\u0bbf \u0ba8\u0bbe\u0b9f\u0bbf\u0baf\u0bc7 \u0b85\u0ba4\u0bc1\u0bb5\u0bc1\u0bae\u0bcd \u0b86\u0b95\u0bb5\u0bc7\u0ba3\u0bcd\u0b9f\u0bc1\u0bae\u0bcd. \u0b86\u0bb4\u0bbf\u0bb5\u0bb3\u0bc8 \u0bb5\u0bc8\u0baf\u0b95\u0ba4\u0bcd\u0ba4\u0bbf\u0bb2\u0bcd, \u0b85\u0ba4\u0bc1\u0bb5\u0bc7 \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0ba4\u0bcd\u0ba4\u0bcb\u0ba9\u0bbf\u0ba9\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bc8 \u0b92\u0bb4\u0bc1\u0b99\u0bcd\u0b95\u0bc1\u0bb1 \u0b8e\u0baa\u0bcd\u0baa\u0bcb\u0ba4\u0bc1\u0bae\u0bcd \u0ba8\u0bbf\u0bae\u0bbf\u0bb0\u0bcd\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd."},{"kural":"45","vari1":"\u0b85\u0ba9\u0bcd\u0baa\u0bc1\u0bae\u0bcd \u0b85\u0bb1\u0ba9\u0bc1\u0bae\u0bcd \u0b89\u0b9f\u0bc8\u0ba4\u0bcd\u0ba4\u0bbe\u0baf\u0bbf\u0ba9\u0bcd \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8","vari2":"\u0baa\u0ba3\u0bcd\u0baa\u0bc1\u0bae\u0bcd \u0baa\u0baf\u0ba9\u0bc1\u0bae\u0bcd \u0b85\u0ba4\u0bc1.","vilakkam":"\u0b95\u0bb2\u0bcd\u0ba8\u0bc6\u0b9e\u0bcd\u0b9a\u0bc8\u0baf\u0bc1\u0bae\u0bcd \u0b95\u0bb0\u0bc8\u0baf\u0b9a\u0bcd\u0b9a\u0bc6\u0baf\u0bcd\u0baf\u0bc1\u0bae\u0bcd \u0b85\u0ba9\u0bcd\u0baa\u0bc1\u0bae\u0bcd, \u0bae\u0bc1\u0bb3\u0bcd\u0bb3\u0bca\u0ba9\u0bcd\u0bb1\u0bc8\u0baf\u0bc1\u0bae\u0bcd \u0bae\u0bb2\u0bb0\u0b9a\u0bcd\u0b9a\u0bc6\u0baf\u0bcd\u0baf\u0bc1\u0bae\u0bcd \u0b85\u0bb1\u0bae\u0bc1\u0bae\u0bcd \u0b92\u0bb0\u0bc1\u0bb5\u0bb0\u0ba4\u0bc1 \u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0bb2\u0bcd \u0b87\u0bb0\u0bc1\u0b95\u0bcd\u0b95\u0bbf\u0bb1\u0ba4\u0bbe\u0baf\u0bbf\u0ba9\u0bcd, \u0b85\u0ba4\u0bc1\u0bb5\u0bc7 \u0b85\u0bb5\u0bb0\u0bcd \u0bb5\u0bbe\u0bb4\u0bc1\u0bae\u0bcd \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0ba9\u0bcd \u0baa\u0ba3\u0bcd\u0baa\u0bc1 \u0bae\u0bb1\u0bcd\u0bb1\u0bc1\u0bae\u0bcd \u0baa\u0baf\u0ba9\u0bbe\u0b95\u0bc1\u0bae\u0bcd! \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0ba9\u0bcd \u0baa\u0ba3\u0bcd\u0baa\u0bc1\u0bae\u0bcd \u0baa\u0baf\u0ba9\u0bc1\u0bae\u0bcd, \u0b85\u0ba9\u0bcd\u0baa\u0bc1\u0bae\u0bcd \u0b85\u0bb1\u0ba9\u0bc1\u0bae\u0bbe\u0bae\u0bcd! \u0b85\u0ba9\u0bcd\u0baa\u0bc8\u0baf\u0bc1\u0bae\u0bcd \u0b85\u0bb1\u0ba9\u0bc8\u0baf\u0bc1\u0bae\u0bcd, \u0b95\u0ba3\u0bcd\u0ba3\u0bc1\u0b99\u0bcd\u0b95\u0bb0\u0bc1\u0ba4\u0bcd\u0ba4\u0bc1\u0bae\u0bbe\u0b95 \u0b95\u0bb0\u0bc1\u0ba4\u0bbf\u0baf\u0bbf\u0bb0\u0bc1\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0b85\u0bb1\u0bcd\u0baa\u0bc1\u0ba4 \u0ba4\u0bb5\u0bae\u0bc7 \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8! \u0b85\u0bb5\u0bcd\u0bb5\u0bbf\u0bb0\u0ba3\u0bcd\u0b9f\u0bc1\u0bae\u0bcd, \u0b9a\u0bbf\u0b95\u0bcd\u0b95\u0bb2\u0bcd\u0b95\u0bb3\u0bc8 \u0b95\u0bb2\u0bc8\u0baa\u0bb5\u0bc8. \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0bb2\u0bcd \u0b87\u0ba9\u0bbf\u0bae\u0bc8 \u0b8a\u0b9f\u0bcd\u0b9f\u0bc1\u0baa\u0bb5\u0bc8. \u0b89\u0ba3\u0bcd\u0bae\u0bc8\u0baf\u0bbe\u0ba9 \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0ba9\u0bcd \u0b87\u0bb0\u0bc1 \u0bb5\u0bc7\u0bb0\u0bcd\u0b95\u0bb3\u0bcd \u0b85\u0bb5\u0bc8! \u0b85\u0ba9\u0bcd\u0baa\u0bc1\u0bae\u0bcd \u0b85\u0bb1\u0ba9\u0bc1\u0bae\u0bcd \u0ba8\u0bbf\u0bb1\u0bc8\u0ba8\u0bcd\u0ba4\u0bbf\u0bb0\u0bc1\u0baa\u0bcd\u0baa\u0ba4\u0bc7 \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbf\u0ba9\u0bcd \u0baa\u0ba3\u0bcd\u0baa\u0bc1\u0bae\u0bcd \u0baa\u0baf\u0ba9\u0bc1\u0bae\u0bcd!"},{"kural":"46","vari1":"\u0b85\u0bb1\u0ba4\u0bcd\u0ba4\u0bbe\u0bb1\u0bcd\u0bb1\u0bbf\u0ba9\u0bcd \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0b86\u0bb1\u0bcd\u0bb1\u0bbf\u0ba9\u0bcd \u0baa\u0bc1\u0bb1\u0ba4\u0bcd\u0ba4\u0bbe\u0bb1\u0bcd\u0bb1\u0bbf\u0bb2\u0bcd","vari2":"\u0baa\u0bcb\u0b92\u0baf\u0bcd\u0baa\u0bcd \u0baa\u0bc6\u0bb1\u0bc1\u0bb5 \u0ba4\u0bc6\u0bb5\u0ba9\u0bcd?","vilakkam":"\u0b85\u0bb1\u0bb5\u0bb4\u0bbf\u0baf\u0bbf\u0bb2\u0bcd \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0ba8\u0b9f\u0ba4\u0bcd\u0ba4\u0bc1\u0baa\u0bb5\u0bb0\u0bcd\u0ba4\u0bae\u0b95\u0bcd\u0b95\u0bc1, \u0b85\u0ba4\u0bc1\u0bb5\u0bc7 \u0b89\u0baf\u0bb0\u0bcd\u0ba8\u0bcd\u0ba4 \u0bb5\u0bb4\u0bbf\u0baf\u0bc1\u0bae\u0bcd \u0baa\u0baf\u0ba9\u0bcd\u0ba8\u0bbf\u0bb1\u0bc8\u0ba8\u0bcd\u0ba4\u0ba4\u0bc1\u0bae\u0bbe\u0b95\u0bc1\u0bae\u0bcd. \u0b85\u0ba4\u0bc8\u0bb5\u0bbf\u0b9f\u0bc1\u0ba4\u0bcd\u0ba4\u0bc1, \u0bb5\u0bc7\u0bb1\u0bc1\u0bb5\u0bb4\u0bbf\u0b95\u0bb3\u0bbf\u0bb2\u0bcd \u0b85\u0bb5\u0bb0\u0bcd\u0b95\u0bb3\u0bcd \u0b9a\u0bc6\u0ba9\u0bcd\u0bb1\u0bc1 \u0baa\u0bc6\u0bb1\u0bc1\u0bae\u0bcd \u0baa\u0baf\u0ba9\u0bcd\u0ba4\u0bbe\u0ba9\u0bcd \u0b8e\u0ba9\u0bcd\u0ba9? \u0b87\u0ba8\u0bcd\u0ba4 \u0b95\u0bc1\u0bb1\u0bb3\u0bcd \u0b95\u0bc2\u0bb1\u0bb5\u0bbf\u0bb4\u0bc8\u0bb5\u0ba4\u0bc1, \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbf\u0bb2\u0bcd \u0b85\u0bb1\u0b9e\u0bcd\u0b9a\u0bc6\u0bb1\u0bbf\u0baf \u0bb5\u0bbe\u0bb4\u0bcd\u0ba8\u0bcd\u0ba4\u0bbe\u0bb2\u0bcd, \u0b87\u0ba9\u0bcd\u0ba9\u0bb2\u0bcd\u0b95\u0bb3\u0bc7\u0ba4\u0bc1\u0bae\u0bbf\u0bb2\u0bbe\u0bae\u0bb2\u0bcd \u0b8e\u0baa\u0bcd\u0baa\u0bcb\u0ba4\u0bc1\u0bae\u0bcd \u0b87\u0ba9\u0bcd\u0baa\u0bae\u0bcd \u0baa\u0baf\u0ba9\u0bbe\u0b95 \u0b95\u0bbf\u0b9f\u0bcd\u0b9f\u0bc1\u0bae\u0bcd \u0b8e\u0ba9\u0bcd\u0baa\u0ba4\u0bc1\u0ba4\u0bbe\u0ba9\u0bcd\u2026 \u0b85\u0bb5\u0bcd\u0bb5\u0bbf\u0ba9\u0bcd\u0baa\u0bae\u0bcd \u0b95\u0ba3\u0bcd\u0b9f\u0bcb\u0bb0\u0bcd\u0b95\u0bb3\u0bbf\u0ba9\u0bcd \u0bae\u0ba9\u0bae\u0bcd, \u0b87\u0b95\u0bcd\u0b95\u0bb1\u0bc8\u0baf\u0bc8\u0bb5\u0bbf\u0b9f\u0bcd\u0b9f\u0bc1 \u0b85\u0b95\u0bcd\u0b95\u0bb1\u0bc8\u0baf\u0bc8 \u0ba4\u0bc7\u0b9f\u0bbe\u0ba4\u0bc1! \u0b85\u0bb1\u0b9e\u0bcd\u0b9a\u0bc6\u0bb1\u0bbf\u0ba8\u0bcd\u0ba4 \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0b8e\u0ba9\u0bcd\u0baa\u0ba4\u0bc1 \u0b87\u0ba9\u0bbf\u0baa\u0bcd\u0baa\u0bbe\u0ba9 \u0b85\u0ba9\u0bc1\u0baa\u0bb5\u0b99\u0bcd\u0b95\u0bb3\u0bc8 \u0ba4\u0bae\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbf\u0bb2\u0bc1\u0bae\u0bcd, \u0b87\u0bb2\u0bcd\u0bb2\u0b9e\u0bcd\u0b9a\u0bbe\u0bb0\u0bcd\u0ba8\u0bcd\u0ba4\u0bcb\u0bb0\u0bcd\u0b95\u0bb3\u0bbf\u0ba9\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbf\u0bb2\u0bc1\u0bae\u0bcd \u0b9a\u0bc7\u0bb0\u0bcd\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd. \u0b85\u0ba4\u0bc1\u0bb5\u0bc7 \u0b89\u0baf\u0bb0\u0bcd \u0bb5\u0bb4\u0bbf\u0baf\u0bbe\u0b95\u0bc1\u0bae\u0bcd! \u0b85\u0ba4\u0bc8\u0bb5\u0bbf\u0b9f\u0bc1\u0ba4\u0bcd\u0ba4\u0bc1 \u0bb5\u0bc7\u0bb1\u0bc1\u0bb5\u0bb4\u0bbf\u0baf\u0bbf\u0bb2\u0bcd \u0b9a\u0bc6\u0bb2\u0bcd\u0bb5\u0ba4\u0ba9\u0bbe\u0bb2\u0bcd \u0b89\u0ba3\u0bcd\u0b9f\u0bcb \u0baa\u0baf\u0ba9\u0bcd!?"},{"kural":"47","vari1":"\u0b87\u0baf\u0bb2\u0bcd\u0baa\u0bbf\u0ba9\u0bbe\u0ba9\u0bcd \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0bb5\u0bbe\u0bb4\u0bcd\u0baa\u0bb5\u0ba9\u0bcd \u0b8e\u0ba9\u0bcd\u0baa\u0bbe\u0ba9\u0bcd","vari2":"\u0bae\u0bc1\u0baf\u0bb2\u0bcd\u0bb5\u0bbe\u0bb0\u0bc1\u0bb3\u0bcd \u0b8e\u0bb2\u0bcd\u0bb2\u0bbe\u0bae\u0bcd \u0ba4\u0bb2\u0bc8.","vilakkam":"\u0b85\u0bb1\u0bb5\u0bb4\u0bbf\u0baf\u0bbf\u0bb2\u0bcd \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0ba8\u0b9f\u0ba4\u0bcd\u0ba4\u0bc1\u0bae\u0bcd \u0b87\u0baf\u0bb2\u0bcd\u0baa\u0bc1\u0b9f\u0bc8\u0baf\u0bb5\u0bb0\u0bcd, \u0b8e\u0bb2\u0bcd\u0bb2\u0bbe \u0ba4\u0bbf\u0bb1\u0bae\u0bc8\u0b95\u0bb3\u0bbf\u0bb2\u0bc1\u0bae\u0bcd \u0b93\u0b99\u0bcd\u0b95\u0bbf\u0baf \u0baa\u0bc6\u0bb0\u0bc1\u0ba8\u0bcd\u0ba4\u0bbf\u0bb1\u0bae\u0bc8 \u0baa\u0bc6\u0bb1\u0bcd\u0bb1\u0bb5\u0bb0\u0bcd! \u0b87\u0b99\u0bcd\u0b95\u0bc1, \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bc8 \u0b87\u0baf\u0bb2\u0bcd\u0baa\u0bbe\u0baf\u0bcd (\u0b85\u0bb1\u0b99\u0bcd\u0b95\u0bcb\u0bb0\u0bcd\u0ba4\u0bcd\u0ba4\u0bc1 \u0bb5\u0bbe\u0bb4\u0bc1\u0ba4\u0bb2\u0bcd) \u0bb5\u0bbe\u0bb4\u0bc1\u0bb5\u0ba4\u0bc8\u0baf\u0bc7 \u0b92\u0bb0\u0bc1 \u0b95\u0bb2\u0bc8 \u0b8e\u0ba9\u0bcd\u0bb1\u0bc1\u0bae\u0bcd, \u0b85\u0b95\u0bcd\u0b95\u0bb2\u0bc8 \u0b8e\u0b95\u0bcd\u0b95\u0bb2\u0bc8\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0b89\u0baf\u0bb0\u0bcd\u0ba8\u0bcd\u0ba4\u0ba4\u0bc1 \u0b8e\u0ba9\u0bcd\u0bb1\u0bc1\u0bae\u0bcd \u0bb5\u0bb3\u0bcd\u0bb3\u0bc1\u0bb5\u0bb0\u0bcd \u0b95\u0bc2\u0bb1\u0b95\u0bcd\u0b95\u0bc7\u0b9f\u0bcd\u0b95\u0bbf\u0bb1\u0bcb\u0bae\u0bcd! \u0bae\u0bc1\u0baf\u0bb2\u0bcd\u0bb5\u0bbe\u0bb0\u0bc1\u0bb3\u0bcd \u0b8e\u0bb2\u0bcd\u0bb2\u0bbe\u0bae\u0bcd \u0ba4\u0bb2\u0bc8 \u0b8e\u0ba9\u0bc1\u0bae\u0bcd\u0baa\u0bcb\u0ba4\u0bc1, \u0b85\u0bb1\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bbf\u0bb2\u0bcd \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0bb5\u0bbe\u0bb4\u0bcd\u0baa\u0bb5\u0bb0\u0bcb\u0b9f\u0bc1, \u0bb5\u0bbe\u0bb4 \u0bae\u0bc1\u0baf\u0bb2\u0bcd\u0baa\u0bb5\u0bb0\u0bc1\u0b99\u0bcd\u0b95\u0bc2\u0b9f, \u0ba4\u0bbf\u0bb1\u0bae\u0bc8\u0baf\u0bbf\u0bb2\u0bcd \u0bae\u0bbf\u0b95\u0bc8\u0ba4\u0bcd\u0ba4\u0bb5\u0bb0\u0bcd \u0b8e\u0ba9 \u0baa\u0bca\u0bb0\u0bc1\u0b9f\u0bcd\u0baa\u0b9f\u0bcd\u0b9f\u0bc1 \u0baa\u0bcb\u0b95\u0bbf\u0bb1\u0ba4\u0bc1! \u0b85\u0bb1\u0bb5\u0bb4\u0bbf\u0baf\u0bbf\u0bb2\u0bcd \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0ba8\u0b9f\u0ba4\u0bcd\u0ba4\u0bc1\u0bb5\u0ba4\u0bc1 \u0b92\u0bb0\u0bc1 \u0baa\u0bc6\u0bb0\u0bc1\u0b99\u0bcd\u0b95\u0bb2\u0bc8!"},{"kural":"48","vari1":"\u0b86\u0bb1\u0bcd\u0bb1\u0bbf\u0ba9\u0bcd \u0b92\u0bb4\u0bc1\u0b95\u0bcd\u0b95\u0bbf \u0b85\u0bb1\u0ba9\u0bbf\u0bb4\u0bc1\u0b95\u0bcd\u0b95\u0bbe \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8","vari2":"\u0ba8\u0bcb\u0bb1\u0bcd\u0baa\u0bbe\u0bb0\u0bbf\u0ba9\u0bcd \u0ba8\u0bcb\u0ba9\u0bcd\u0bae\u0bc8 \u0b89\u0b9f\u0bc8\u0ba4\u0bcd\u0ba4\u0bc1.","vilakkam":"\u0b85\u0bb1\u0bb5\u0bb4\u0bbf\u0baf\u0bbf\u0bb2\u0bcd \u0ba8\u0b9f\u0ba8\u0bcd\u0ba4\u0bca\u0bb4\u0bc1\u0b95\u0bbf, \u0b8e\u0bb5\u0bcd\u0bb5\u0bbf\u0ba4\u0ba4\u0bcd\u0ba4\u0bbf\u0bb2\u0bc1\u0bae\u0bcd \u0ba8\u0bbf\u0bb2\u0bc8\u0ba4\u0bb5\u0bb1\u0bbe\u0bae\u0bb2\u0bcd \u0b85\u0bb5\u0bcd\u0bb5\u0bb1\u0ba4\u0bcd\u0ba4\u0bc8 \u0b95\u0b9f\u0bc8\u0baa\u0bbf\u0b9f\u0bbf\u0ba4\u0bcd\u0ba4\u0bc1 \u0bb5\u0bbe\u0bb4\u0bc1\u0bae\u0bcd \u0b87\u0bb2\u0bcd\u0bb2\u0bb1 \u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0b8e\u0ba9\u0bcd\u0baa\u0ba4\u0bc1, \u0ba4\u0bb5 \u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bc1 \u0baa\u0bc1\u0bb0\u0bbf\u0bb5\u0bcb\u0bb0\u0bbf\u0ba9\u0bcd \u0ba4\u0bb5 \u0bb5\u0bb2\u0bbf\u0bae\u0bc8\u0baf\u0bbf\u0ba9\u0bc1\u0bae\u0bcd \u0bae\u0bc7\u0bb2\u0bbe\u0ba9\u0ba4\u0bc1. \u0ba4\u0bb5 \u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bc6\u0ba9\u0bcd\u0baa\u0ba4\u0bc1, \u0ba8\u0bc0\u0ba3\u0bcd\u0b9f \u0ba4\u0bbe\u0b9f\u0bbf\u0baf\u0bc1\u0b9f\u0ba9\u0bc1\u0bae\u0bcd \u0b9a\u0b9f\u0bc8\u0bae\u0bc1\u0b9f\u0bbf\u0baf\u0bc1\u0b9f\u0ba9\u0bc1\u0bae\u0bcd \u0bae\u0bb0\u0ba4\u0bcd\u0ba4\u0b9f\u0bbf\u0baf\u0bbf\u0bb2\u0bcd \u0b95\u0ba3\u0bcd\u0bae\u0bc2\u0b9f\u0bbf\u0baf\u0bbf\u0bb0\u0bc1\u0baa\u0bcd\u0baa\u0ba4\u0ba9\u0bcd\u0bb1\u0bc1. \u0ba4\u0bb5 \u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0b8e\u0ba9\u0bcd\u0baa\u0ba4\u0bc1, \u0b8a\u0bb0\u0bcd \u0b89\u0bb2\u0b95\u0bae\u0bcd \u0b85\u0ba9\u0bcd\u0bb1\u0bbe\u0b9f\u0bae\u0bcd \u0b8f\u0bb1\u0bcd\u0bb1\u0bc1 \u0ba8\u0b9f\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0b8f\u0ba4\u0bcb \u0b92\u0ba9\u0bcd\u0bb1\u0bc8 \u0ba4\u0bc1\u0bb1\u0ba8\u0bcd\u0ba4\u0bcb \u0b85\u0bb2\u0bcd\u0bb2\u0ba4\u0bc1 \u0b9a\u0bbf\u0bb2\u0bb5\u0bb1\u0bcd\u0bb1\u0bc8 \u0ba4\u0bbe\u0bae\u0bc7 \u0b95\u0b9f\u0bc8\u0baa\u0bbf\u0b9f\u0bbf\u0ba4\u0bcd\u0ba4\u0bcb \u0bb5\u0bbe\u0bb4\u0bc1\u0bae\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8. \u0bb5\u0bc8\u0bb0\u0bbe\u0b95\u0bcd\u0b95\u0bbf\u0baf\u0bae\u0bcd \u0b8e\u0ba9\u0bc1\u0bae\u0bcd \u0b95\u0baf\u0bbf\u0bb1\u0bcd\u0bb1\u0bbe\u0bb2\u0bcd \u0b85\u0bb5\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0b85\u0bb5\u0bbf\u0bb4\u0bbe\u0bb5\u0ba3\u0bcd\u0ba3\u0bae\u0bcd \u0b95\u0b9f\u0bcd\u0b9f\u0baa\u0bcd\u0baa\u0b9f\u0bcd\u0b9f\u0bbf\u0bb0\u0bc1\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd. \u0b85\u0bb5\u0bcd\u0bb5\u0ba3\u0bcd\u0ba3\u0bae\u0bcd, \u0b85\u0bb1\u0bae\u0bcd \u0b8e\u0ba9\u0bc1\u0bae\u0bcd \u0b85\u0bb0\u0bc1\u0b99\u0bcd\u0b95\u0bc1\u0ba3\u0ba4\u0bcd\u0ba4\u0bc8 \u0b95\u0b9f\u0bc8\u0baa\u0bbf\u0b9f\u0bbf\u0ba4\u0bcd\u0ba4\u0bc1, \u0b93\u0bb0\u0bc1\u0baa\u0bcb\u0ba4\u0bc1\u0bae\u0bcd \u0b85\u0ba4\u0bc8 \u0bb5\u0bbf\u0b9f\u0bbe\u0bae\u0bb2\u0bcd \u0bb5\u0bbe\u0bb4\u0bc1\u0bae\u0bcd \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bc6\u0ba9\u0bcd\u0baa\u0ba4\u0bc1 \u0b92\u0bb0\u0bc1 \u0bae\u0bc7\u0bb2\u0bbe\u0ba9 \u0ba4\u0bb5\u0bae\u0bcd!"},{"kural":"49","vari1":"\u0b85\u0bb1\u0ba9\u0bcd \u0b8e\u0ba9\u0baa\u0bcd \u0baa\u0b9f\u0bcd\u0b9f\u0ba4\u0bc7 \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0b85\u0b83\u0ba4\u0bc1\u0bae\u0bcd","vari2":"\u0baa\u0bbf\u0bb1\u0ba9\u0bcd\u0baa\u0bb4\u0bbf\u0baa\u0bcd\u0baa \u0ba4\u0bbf\u0bb2\u0bcd\u0bb2\u0bbe\u0baf\u0bbf\u0ba9\u0bcd \u0ba8\u0ba9\u0bcd\u0bb1\u0bc1.","vilakkam":"\u0b85\u0bb1\u0bae\u0bcd \u0b8e\u0ba9 \u0b85\u0ba9\u0bc8\u0bb5\u0bb0\u0bbe\u0bb2\u0bc1\u0bae\u0bcd \u0b8f\u0bb1\u0bcd\u0bb1\u0baa\u0bcd\u0baa\u0b9f\u0bc1\u0bb5\u0ba4\u0bc1, \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8\u0baf\u0bc7 \u0b86\u0b95\u0bc1\u0bae\u0bcd. \u0b85\u0ba4\u0bcd\u0ba4\u0b95\u0bc8\u0baf \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8, \u0bae\u0bb1\u0bcd\u0bb1\u0bb5\u0bb0\u0bcd \u0baa\u0bb4\u0bbf\u0b95\u0bcd\u0b95\u0bbe\u0ba4 \u0bb5\u0ba3\u0bcd\u0ba3\u0bae\u0bcd \u0b87\u0bb0\u0bc1\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bbe\u0baf\u0bbf\u0ba9\u0bcd \u0b87\u0ba9\u0bcd\u0ba9\u0bae\u0bc1\u0bae\u0bcd \u0b9a\u0bbf\u0bb1\u0baa\u0bcd\u0baa\u0bc1\u0ba4\u0bbe\u0ba9\u0bcd! \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0b85\u0ba4\u0bbf\u0b95\u0bbe\u0bb0\u0ba4\u0bcd\u0ba4\u0bbf\u0bb2\u0bcd, \u0b85\u0bb1\u0ba9\u0bc8\u0baf\u0bc1\u0bae\u0bcd \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bc8\u0baf\u0bc1\u0bae\u0bcd \u0b92\u0ba9\u0bcd\u0bb1\u0bcb\u0b9f\u0bca\u0ba9\u0bcd\u0bb1\u0bc1 \u0baa\u0bbf\u0bb0\u0bbf\u0baf\u0bbe \u0b95\u0bc2\u0bb1\u0bc1\u0b95\u0bb3\u0bbe\u0b95 \u0bb5\u0bb3\u0bcd\u0bb3\u0bc1\u0bb5\u0bb0\u0bcd \u0b87\u0baf\u0bae\u0bcd\u0baa \u0b85\u0bb1\u0bbf\u0b95\u0bbf\u0bb1\u0bcb\u0bae\u0bcd. \u0baa\u0bbe\u0bb0\u0ba4\u0b95\u0ba4\u0bc8\u0baf\u0bbf\u0bb2\u0bcd \u0bb5\u0bb0\u0bc1\u0bae\u0bcd \u0baa\u0bc6\u0bb0\u0bc1\u0bae\u0bcd\u0baa\u0bcb\u0bb0\u0bbf\u0ba9\u0bcd \u0bae\u0bc1\u0b9f\u0bbf\u0bb5\u0bbf\u0bb2\u0bcd, \u0baa\u0bbe\u0b9f\u0bcd\u0b9f\u0ba9\u0bbe\u0bb0\u0bcd \u0bb5\u0bc0\u0b9a\u0bc1\u0bae\u0bb0\u0bcd, \u201c\u0b8e\u0ba9\u0b95\u0bcd\u0b95\u0bc7\u0ba9\u0bcd \u0b87\u0ba8\u0bcd\u0ba8\u0bbf\u0bb2\u0bc8?\u201d \u0b8e\u0ba9 \u0b95\u0ba3\u0bcd\u0ba3\u0ba9\u0bbf\u0b9f\u0bae\u0bcd \u0bb5\u0bbf\u0ba9\u0bb5, \u201c\u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0b9e\u0bcd\u0b9a\u0bc6\u0baf\u0bbe\u0bae\u0bb2\u0bcd \u0ba4\u0bc1\u0bb1\u0bb5\u0bb1\u0b9e\u0bcd\u0b9a\u0bc6\u0ba9\u0bcd\u0bb1\u0ba4\u0bc7 \u0b8a\u0bb4\u0bcd\u0bb5\u0bbf\u0ba9\u0bc8\u201d \u0b8e\u0ba9 \u0b95\u0ba3\u0bcd\u0ba3\u0ba9\u0bcd \u0b95\u0bc2\u0bb1\u0bc1\u0bb5\u0ba4\u0bbe\u0b95 \u0b89\u0ba3\u0bcd\u0b9f\u0bc1. \u0b87\u0bb2\u0bcd\u0bb5\u0bbe\u0bb4\u0bcd\u0b95\u0bcd\u0b95\u0bc8 \u0b8e\u0ba9\u0bc1\u0bae\u0bcd \u0b85\u0bb1\u0ba4\u0bcd\u0ba4\u0bc8 \u0ba4\u0bc1\u0bb1\u0baa\u0bcd\u0baa\u0ba4\u0bc1 \u0b8f\u0bb1\u0bcd\u0baa\u0ba9\u0bcd\u0bb1\u0bc1! \u0b87\u0bb2\u0bcd\u0bb2\u0bb1\u0bae\u0bcd \u0b8e\u0ba9\u0bcd\u0baa\u0ba4\u0bc1 \u0ba4\u0bb5\u0bae\u0bcd! \u0baa\u0bc1\u0bb0\u0bbf\u0ba8\u0bcd\u0ba4\u0bc1\u0ba8\u0b9f\u0ba8\u0bcd\u0ba4\u0bbe\u0bb2\u0bcd \u0bb5\u0bb0\u0bae\u0bcd!"},{"kural":"50","vari1":"\u0bb5\u0bc8\u0baf\u0ba4\u0bcd\u0ba4\u0bc1\u0bb3\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbe\u0b99\u0bcd\u0b95\u0bc1 \u0bb5\u0bbe\u0bb4\u0bcd\u0baa\u0bb5\u0ba9\u0bcd \u0bb5\u0bbe\u0ba9\u0bcd \u0b89\u0bb1\u0bc8\u0baf\u0bc1\u0bae\u0bcd","vari2":"\u0ba4\u0bc6\u0baf\u0bcd\u0bb5\u0ba4\u0bcd\u0ba4\u0bc1\u0bb3\u0bcd \u0bb5\u0bc8\u0b95\u0bcd\u0b95\u0baa\u0bcd \u0baa\u0b9f\u0bc1\u0bae\u0bcd.","vilakkam":"\u0bb5\u0bc8\u0baf\u0b95\u0bae\u0bbe\u0ba9 \u0b87\u0ba8\u0bcd\u0ba4 \u0b89\u0bb2\u0b95\u0bbf\u0bb2\u0bcd, \u0b89\u0b95\u0ba8\u0bcd\u0ba4 \u0bae\u0bc1\u0bb1\u0bc8\u0baf\u0bbf\u0bb2\u0bcd \u0b89\u0bb1\u0bcd\u0bb1 \u0b85\u0bb1\u0ba4\u0bcd\u0ba4\u0bc1\u0b9f\u0ba9\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0baa\u0bb5\u0bb0\u0bcd\u0b95\u0bb3\u0bcd, \u0baa\u0bb0\u0bb5\u0bc6\u0bb3\u0bbf\u0baf\u0bc6\u0ba9\u0bc1\u0bae\u0bcd \u0b88\u0bb1\u0bbf\u0bb2\u0bbe \u0bb5\u0bc6\u0bb3\u0bbf\u0baf\u0bbf\u0bb2\u0bcd, \u0b87\u0bb1\u0bc8\u0ba8\u0bbf\u0bb2\u0bc8\u0baf\u0b9f\u0bc8\u0ba8\u0bcd\u0ba4\u0bc1 \u0ba8\u0bbf\u0bb1\u0bcd\u0baa\u0bbe\u0bb0\u0bcd\u0b95\u0bb3\u0bcd! \u0baf\u0bbe\u0bb5\u0bc1\u0bae\u0bcd \u0ba4\u0bc1\u0bb1\u0ba8\u0bcd\u0ba4\u0bbe\u0bb2\u0bc7 \u0ba4\u0bc6\u0baf\u0bcd\u0bb5\u0ba8\u0bbf\u0bb2\u0bc8\u0baf\u0b9f\u0bc8\u0baf\u0bae\u0bc1\u0b9f\u0bbf\u0baf\u0bc1\u0bae\u0bcd \u0b8e\u0ba9\u0bc1\u0bae\u0bcd \u0b95\u0bca\u0bb3\u0bcd\u0b95\u0bc8\u0baf\u0bc8 \u0ba4\u0b95\u0bb0\u0bcd\u0b95\u0bcd\u0b95\u0bc1\u0bae\u0bcd \u0bb5\u0bbf\u0ba4\u0bae\u0bbe\u0b95, \u201c\u0ba4\u0bc6\u0baf\u0bcd\u0bb5\u0ba4\u0bcd\u0ba4\u0bc1\u0bb3\u0bcd \u0bb5\u0bc8\u0b95\u0bcd\u0b95\u0baa\u0bcd\u0baa\u0b9f\u0bc1\u0baa\u0bb5\u0bb0\u0bcd\u0b95\u0bb3\u0bcd, \u0bb5\u0bc8\u0baf\u0ba4\u0bcd\u0ba4\u0bc1\u0bb3\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbe\u0b99\u0bcd\u0b95\u0bc1 \u0bb5\u0bbe\u0bb4\u0bb5\u0bc7\u0ba3\u0bcd\u0b9f\u0bc1\u0bae\u0bcd\u201d \u0b8e\u0ba9 \u0bb5\u0bb3\u0bcd\u0bb3\u0bc1\u0bb5\u0bb0\u0bcd \u0b95\u0bc2\u0bb1\u0bc1\u0bb5\u0ba4\u0bbf\u0bb2\u0bbf\u0bb0\u0bc1\u0ba8\u0bcd\u0ba4\u0bc1 \u0ba8\u0bbe\u0bae\u0bcd \u0bae\u0bc6\u0baf\u0bcd\u0bb5\u0bbf\u0bb3\u0b99\u0bcd\u0b95\u0bb5\u0bc7\u0ba3\u0bcd\u0b9f\u0bc1\u0bae\u0bcd. \u0bae\u0bc7\u0bb2\u0bc1\u0bae\u0bcd, \u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbe\u0b99\u0bcd\u0b95\u0bc1 \u0bb5\u0bbe\u0bb4\u0bcd\u0ba8\u0bcd\u0ba4\u0bc1 \u0b87\u0bb1\u0bc8\u0ba8\u0bbf\u0bb2\u0bc8 \u0b85\u0b9f\u0bc8\u0bb5\u0ba4\u0bc1 \u0ba4\u0bae\u0bbf\u0bb4\u0bb0\u0bcd \u0b87\u0bb1\u0bc8\u0baf\u0bbe\u0ba3\u0bcd\u0bae\u0bc8! \u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbe\u0b99\u0bcd\u0b95\u0bc1 \u0bb5\u0bbe\u0bb4\u0bc1\u0ba4\u0bb2\u0bcd \u0b8e\u0ba9\u0bcd\u0baa\u0ba4\u0bc1, \u0bae\u0b95\u0bcd\u0b95\u0bb3\u0bc1\u0b95\u0bcd\u0b95\u0bc1 \u0ba8\u0bb2\u0bcd\u0bb5\u0bb4\u0bbf \u0baa\u0bc1\u0b95\u0b9f\u0bcd\u0b9f\u0bb2\u0bcd, \u0bae\u0b95\u0bcd\u0b95\u0bb3\u0bc1\u0b95\u0bcd\u0b95\u0bbe\u0b95 \u0baa\u0bcb\u0bb0\u0bcd\u0baa\u0bc1\u0b95\u0bb2\u0bcd \u0b8e\u0ba9 \u0b85\u0bb1\u0ba4\u0bcd\u0ba4\u0bbf\u0bb2\u0bcd \u0b95\u0bcb\u0bb2\u0bcb\u0b9a\u0bcd\u0b9a\u0bc1\u0ba4\u0bb2\u0bc7! \u0bb5\u0bc8\u0baf\u0ba4\u0bcd\u0ba4\u0bbf\u0bb2\u0bcd \u0bb5\u0bbe\u0bb4\u0bcd\u0bb5\u0bbe\u0b99\u0bcd\u0b95\u0bc1 \u0bb5\u0bbe\u0bb4\u0bcd\u0ba8\u0bcd\u0ba4\u0bbe\u0bb2\u0bcd, \u0bb5\u0bbe\u0ba9\u0bc1\u0bb1\u0bc8\u0baf\u0bc1\u0bae\u0bcd \u0ba4\u0bc6\u0baf\u0bcd\u0bb5 \u0baa\u0ba4\u0bb5\u0bbf!"}]')}}]);